import React, { useEffect } from "react";

import axios from "axios";
// import { Container } from './styles';

function Playlist() {
  useEffect(() => {
    axios
      .get("https://api.spotify.com/v1/browse/featured-playlists")
      .then((response) => {
        console.log(response);
      });
  }, []);
  return <div />;
}

export default Playlist;
